import SearchForm from "./SearchForm";

const NewSearch = () => {
    const saveSearchDataHandler = (userSearchVal) => {
        console.log(userSearchVal)

        async function getDeezerResult() {
            const url = 'https://cors-anywhere.herokuapp.com/https://api.deezer.com/version/service/id/method/?q=' + userSearchVal;
            console.log(url);
            const response = await fetch(url, {mode: 'no-cors'});
            console.log(response)
            const data = response.json();
            console.log(data);
        }

        const deezerResult = getDeezerResult(userSearchVal);
        console.log(deezerResult)

    }
    return (
        <div>
            <SearchForm onSaveSearchData={saveSearchDataHandler}/>
        </div>
    )
};
export default NewSearch;
